pragma solidity >=0.4.21 <0.7.0;

import "./provableAPI_0.6.sol";
import "./ContractRegistry.sol";
import "./PolicyManagement.sol";

contract ClaimsManagement is usingProvable {
    // interfaces & contract instantiations

    ContractRegistry public contractRegistry;
    PolicyManagement public policyManagement;

    // events

    event ContractRegistryInitiated(address _contractRegistryAddress);

    event FailedOracleCall(uint256 date, bytes32 _policyIDhash);
    event OracleCallSent(uint256 date, bytes32 _policyIDhash, string _APIcall);
    event OracleAnswerReceived(uint256 date, bytes32 _queryID, string _result);

    // contract variables in storage

    address public contractOwner;
    mapping(bytes32 => bytes32) public queryIDregister;
    string public lastOracleResult; // for debugging

    // modifiers

    modifier onlyOwner() {
        require(
            msg.sender == contractOwner,
            "Only the contract owner can call this function"
        );
        _;
    }

    // constructor function

    constructor() public {
        contractOwner = msg.sender;
    }

    // oracle functions

    function getOracleConfirmation(
        bytes32 _policyIDhash,
        string calldata _KYCidentifier
    ) public {
        require(
            msg.sender == contractRegistry.policyManagementContract(),
            "Only the policy management contract can call this function"
        );

        /* REMOVED FOR TESTING purposes
        if (provable_getPrice("URL") > address(this).balance) {
            emit FailedOracleCall(now, _policyIDhash);
        } else {
            string memory s1 =
                "json(https://firestore.googleapis.com/v1/projects/cherishdb-10aa5/databases/(default)/documents/RNIPP/";
            string memory s2 = _KYCidentifier;
            string memory s3 = ").fields.status.stringValue";
            string memory APIcall = string(abi.encodePacked(s1, s2, s3));

            bytes32 queryID = provable_query("URL", APIcall);
            queryIDregister[queryID] = _policyIDhash;
            emit OracleCallSent(now, _policyIDhash, APIcall);
        } */
        // TO DELETE
        policyManagement.finalizeClaim("deceased", _policyIDhash);
    }

    function __callback(bytes32 _queryID, string memory _result)
        public
        override
    {
        require(
            msg.sender == provable_cbAddress(),
            "Only the oracle can call this function"
        );
        emit OracleAnswerReceived(now, _queryID, _result);

        bytes32 _policyIDhash = queryIDregister[_queryID];
        // to delete
        lastOracleResult = _result;

        policyManagement.finalizeClaim(_result, _policyIDhash);

        delete queryIDregister[_queryID];
    }

    // public functions

    function setContractRegistryAndAddresses(address _contractRegistry)
        public
        onlyOwner
    {
        require(
            _contractRegistry != address(0),
            "Contract Registry address must be a valid address"
        );
        _setContractRegistryAndAddresses(_contractRegistry);
    }

    // private functions

    function _setContractRegistryAndAddresses(address _contractRegistry)
        private
    {
        contractRegistry = ContractRegistry(_contractRegistry);
        policyManagement = PolicyManagement(
            contractRegistry.policyManagementContract()
        );
        emit ContractRegistryInitiated(_contractRegistry);
    }
}
